import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { useAuth } from '../../hooks/useAuth';
import { supabase } from '../../services/supabaseClient';
import { Line } from 'react-chartjs-2';

const Dashboard = () => {
  const { user } = useAuth();
  const [stats, setStats] = useState({
    totalUsers: 0,
    activeClients: 0,
    activeTherapists: 0,
    totalRevenue: 0,
    activeBehaviors: 0,
    averageSentiment: 0
  });
  const [recentUsers, setRecentUsers] = useState([]);
  const [userGrowthData, setUserGrowthData] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchDashboardData = async () => {
      try {
        // Fetch total users count
        const { count: usersCount, error: usersError } = await supabase
          .from('users')
          .select('*', { count: 'exact', head: true });

        if (usersError) throw usersError;

        // Fetch active clients count
        const { count: clientsCount, error: clientsError } = await supabase
          .from('clients')
          .select('*', { count: 'exact', head: true })
          .eq('status', 'active');

        if (clientsError) throw clientsError;

        // Fetch active therapists count
        const { count: therapistsCount, error: therapistsError } = await supabase
          .from('therapists')
          .select('*', { count: 'exact', head: true })
          .eq('status', 'active');

        if (therapistsError) throw therapistsError;

        // Fetch active behaviors count
        const { count: behaviorsCount, error: behaviorsError } = await supabase
          .from('behaviors')
          .select('*', { count: 'exact', head: true })
          .eq('active', true);

        if (behaviorsError) throw behaviorsError;

        // Fetch recent users
        const { data: recentUsersData, error: recentUsersError } = await supabase
          .from('users')
          .select('*, clients (*), therapists (*)')
          .order('created_at', { ascending: false })
          .limit(5);

        if (recentUsersError) throw recentUsersError;

        // Fetch user growth data for the last 30 days
        const thirtyDaysAgo = new Date();
        thirtyDaysAgo.setDate(thirtyDaysAgo.getDate() - 30);

        const { data: growthData, error: growthError } = await supabase
          .from('users')
          .select('created_at')
          .gte('created_at', thirtyDaysAgo.toISOString());

        if (growthError) throw growthError;

        // Process growth data for chart
        const dailyCounts = {};
        growthData.forEach(user => {
          const date = new Date(user.created_at).toLocaleDateString();
          dailyCounts[date] = (dailyCounts[date] || 0) + 1;
        });

        const chartData = {
          labels: Object.keys(dailyCounts),
          datasets: [{
            label: 'New Users',
            data: Object.values(dailyCounts),
            borderColor: 'rgb(75, 192, 192)',
            tension: 0.1
          }]
        };

        setStats({
          totalUsers: usersCount,
          activeClients: clientsCount,
          activeTherapists: therapistsCount,
          activeBehaviors: behaviorsCount,
          totalRevenue: 0, // This would come from your payment processing system
          averageSentiment: 0 // This would be calculated from message sentiments
        });
        setRecentUsers(recentUsersData);
        setUserGrowthData(chartData);
      } catch (error) {
        console.error('Error fetching dashboard data:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchDashboardData();
  }, []);

  if (loading) {
    return (
      <div className="flex items-center justify-center h-full">
        <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-primary-500"></div>
      </div>
    );
  }

  return (
    <div className="space-y-6">
      {/* Welcome Section */}
      <div className="bg-white rounded-lg shadow p-6">
        <h1 className="text-2xl font-semibold text-secondary-900">
          Admin Dashboard
        </h1>
        <p className="mt-2 text-secondary-600">
          Monitor and manage the platform's performance
        </p>
      </div>

      {/* Quick Stats */}
      <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
        <div className="bg-white rounded-lg shadow p-6">
          <h3 className="text-lg font-medium text-secondary-900">Total Users</h3>
          <p className="mt-2 text-3xl font-bold text-primary-600">
            {stats.totalUsers}
          </p>
          <div className="mt-2 flex justify-between text-sm">
            <span className="text-secondary-600">Clients: {stats.activeClients}</span>
            <span className="text-secondary-600">Therapists: {stats.activeTherapists}</span>
          </div>
        </div>

        <div className="bg-white rounded-lg shadow p-6">
          <h3 className="text-lg font-medium text-secondary-900">Active Behaviors</h3>
          <p className="mt-2 text-3xl font-bold text-primary-600">
            {stats.activeBehaviors}
          </p>
        </div>

        <div className="bg-white rounded-lg shadow p-6">
          <h3 className="text-lg font-medium text-secondary-900">Monthly Revenue</h3>
          <p className="mt-2 text-3xl font-bold text-primary-600">
            ${stats.totalRevenue.toFixed(2)}
          </p>
        </div>
      </div>

      {/* User Growth Chart */}
      {userGrowthData && (
        <div className="bg-white rounded-lg shadow p-6">
          <h2 className="text-lg font-medium text-secondary-900 mb-4">User Growth</h2>
          <div className="h-64">
            <Line
              data={userGrowthData}
              options={{
                responsive: true,
                maintainAspectRatio: false,
                scales: {
                  y: {
                    beginAtZero: true,
                    ticks: {
                      stepSize: 1
                    }
                  }
                }
              }}
            />
          </div>
        </div>
      )}

      {/* Recent Users */}
      <div className="bg-white rounded-lg shadow p-6">
        <div className="flex justify-between items-center mb-4">
          <h2 className="text-lg font-medium text-secondary-900">Recent Users</h2>
          <Link
            to="/admin/users"
            className="text-primary-600 hover:text-primary-700 text-sm font-medium"
          >
            View All
          </Link>
        </div>

        <div className="overflow-x-auto">
          <table className="min-w-full divide-y divide-secondary-200">
            <thead className="bg-secondary-50">
              <tr>
                <th scope="col" className="px-6 py-3 text-left text-xs font-medium text-secondary-500 uppercase tracking-wider">
                  User
                </th>
                <th scope="col" className="px-6 py-3 text-left text-xs font-medium text-secondary-500 uppercase tracking-wider">
                  Role
                </th>
                <th scope="col" className="px-6 py-3 text-left text-xs font-medium text-secondary-500 uppercase tracking-wider">
                  Status
                </th>
                <th scope="col" className="px-6 py-3 text-left text-xs font-medium text-secondary-500 uppercase tracking-wider">
                  Joined
                </th>
                <th scope="col" className="relative px-6 py-3">
                  <span className="sr-only">Actions</span>
                </th>
              </tr>
            </thead>
            <tbody className="bg-white divide-y divide-secondary-200">
              {recentUsers.map((user) => (
                <tr key={user.id}>
                  <td className="px-6 py-4 whitespace-nowrap">
                    <div className="flex items-center">
                      <div>
                        <div className="text-sm font-medium text-secondary-900">
                          {user.email}
                        </div>
                      </div>
                    </div>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap">
                    <span className="text-sm text-secondary-900">
                      {user.role}
                    </span>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap">
                    <span className={`inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium ${
                      user.status === 'active'
                        ? 'bg-green-100 text-green-800'
                        : 'bg-secondary-100 text-secondary-800'
                    }`}>
                      {user.status}
                    </span>
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-sm text-secondary-500">
                    {new Date(user.created_at).toLocaleDateString()}
                  </td>
                  <td className="px-6 py-4 whitespace-nowrap text-right text-sm font-medium">
                    <Link
                      to={`/admin/users/${user.id}`}
                      className="text-primary-600 hover:text-primary-900"
                    >
                      View
                    </Link>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>

      {/* Quick Actions */}
      <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
        <Link
          to="/admin/behaviors"
          className="bg-white rounded-lg shadow p-6 hover:shadow-md transition-shadow"
        >
          <h3 className="text-lg font-medium text-secondary-900">Manage Behaviors</h3>
          <p className="mt-2 text-secondary-600">
            Configure AI agent behavior presets
          </p>
        </Link>

        <Link
          to="/admin/users"
          className="bg-white rounded-lg shadow p-6 hover:shadow-md transition-shadow"
        >
          <h3 className="text-lg font-medium text-secondary-900">User Management</h3>
          <p className="mt-2 text-secondary-600">
            Manage users and permissions
          </p>
        </Link>

        <Link
          to="/admin/subscriptions"
          className="bg-white rounded-lg shadow p-6 hover:shadow-md transition-shadow"
        >
          <h3 className="text-lg font-medium text-secondary-900">Subscriptions</h3>
          <p className="mt-2 text-secondary-600">
            Manage subscription plans and billing
          </p>
        </Link>
      </div>
    </div>
  );
};

export default Dashboard;
